function randInt(min, max) {
  return Math.floor(Math.random() * (max - min + 1)) + min;
}

let hideBlocks = true
let hintsEnabled = true
let theVM = Scratch.vm

const menuIconURI = 'data:image/png;base64,'

const blockIconURI = 'data:image/png;base64,'

const Logic = {
  guesses: 0,
  guess: 0,
  number: randInt(1, 100),
  hint: '',
  log: 'Number picked! Start guessing!',
};

function GTL(text) {
  Logic.log = text;
  return text;
}

const emoticon = String.fromCodePoint(55537)


function lemonColor() {
  const hexASCII = 'abcdef0123456789';
  const length = hexASCII.length;
  let generated = '#';
  for (let i = 0; i < 6; i++) {
    const ranASCII = Math.floor(Math.random() * length);
    generated += hexASCII.charAt(ranASCII);
  }
  return generated;
} // bludisanlemon my beloved

(function (Scratch) {
  'use strict'; // i need to escape the sandbox
  if (!Scratch.extensions.unsandboxed) {
    throw new Error('baq/Guess The Number API needs to be run UNSANDBOXED\n\nbecause apparently refreshing blocks needs admin privileges or whatever :P');
  }

  class baqSlashGTN {
    getInfo() {
      return {
        id: 'baqSlashGTN',
        color1: '#4287f5',
        menuIconURI: menuIconURI,
        blockIconURI: blockIconURI,
        name: 'baq/Guess the Number API',
        blocks: [
          {
            blockType: Scratch.BlockType.LABEL,
            text: 'Game Blocks',
          },
          {
            opcode: 'startGame',
            blockType: Scratch.BlockType.COMMAND,
            text: 'pick number between [MIN] and [MAX]',
            arguments: {
              MIN: {
                type: Scratch.ArgumentType.NUMBER,
                defaultValue: 1,
              },
              MAX: {
                type: Scratch.ArgumentType.NUMBER,
                defaultValue: 100,
              },
            },
          },
          {
            opcode: 'doGuess',
            blockType: Scratch.BlockType.COMMAND,
            text: 'submit guess [A]',
            arguments: {
              A: {
                type: Scratch.ArgumentType.NUMBER,
                defaultValue: 0,
              },
            },
          },
          {
            opcode: 'returnLog',
            blockType: Scratch.BlockType.REPORTER,
            text: 'result',
          },
          '---',
          {
            func: 'enableMoreBlocks',
            blockType: Scratch.BlockType.BUTTON,
            text: 'show more blocks',
          },
          '---',
          {
            opcode: 'returnGuesses',
            blockType: Scratch.BlockType.REPORTER,
            hideFromPalette: hideBlocks,
            text: 'total guesses',
          },
          {
            opcode: 'returnHint',
            blockType: Scratch.BlockType.REPORTER,
            hideFromPalette: hideBlocks,
            text: 'guess hint',
          },
          {
            opcode: 'returnLastGuess',
            blockType: Scratch.BlockType.REPORTER,
            hideFromPalette: hideBlocks,
            text: 'last guess',
          },
          '---',
          {
            opcode: 'enableHints',
            blockType: Scratch.BlockType.COMMAND,
            hideFromPalette: hideBlocks,
            text: 'enable hints',
          },
          {
            opcode: 'disableHints',
            blockType: Scratch.BlockType.COMMAND,
            hideFromPalette: hideBlocks,
            text: 'disable hints',
          },
          '---',
          {
            opcode: 'guessBool',
            blockType: Scratch.BlockType.BOOLEAN,
            hideFromPalette: hideBlocks,
            text: '??? [COMPARISON] last guess?',
            arguments: {
              COMPARISON: {
                type: Scratch.ArgumentType.STRING,
                menu: "COMPARISON_MENU",
              }
            }
          },
        ],
        // MENUS
        menus: {
          COMPARISON_MENU: {
            acceptReporters: true,
            items: ['>', '=', '<']
          }
        }
        // /MENUS
      };
    }

    startGame(args) {
      const MIN = Scratch.Cast.toNumber(args.MIN);
      const MAX = Scratch.Cast.toNumber(args.MAX);

      if (MIN > MAX) {
        [MIN, MAX] = [MAX, MIN];
      }

      Logic.number = randInt(MIN, MAX);
      Logic.guesses = 0;
      Logic.hint = 'bud you gotta guess first';
      GTL('Number picked between ' + MIN + ' and ' + MAX + '! Start guessing!');
    }

    doGuess(args) {
      const guess = Scratch.Cast.toNumber(args.A);
      Logic.guess = guess;
      if (guess === Logic.number) {
        Logic.guesses += 1;
        Logic.hint = '??? = ' + guess;
        Logic.log = `${guess} was the number!`;
      } else {
        Logic.guesses += 1;
        hintsEnabled ? (Logic.hint = guess > Logic.number ? `??? < ${guess}` : `??? > ${guess}`) : Logic.hint = 'hints are diabled' // ternary operators my beloved
        hintsEnabled ? Logic.log = "Guess again! (" + Logic.hint + ")" : Logic.log = "Guess again!"
      }
      return Logic.log;
    }

    enableMoreBlocks() {
      hideBlocks = false;
      console.log("")
      theVM.extensionManager.refreshBlocks();
    }

    returnGuesses() {
      return Logic.guesses;
    }
    returnHint() {
      return Logic.hint;
    }
    returnLog() {
      return Logic.log;
    }
    returnLastGuess() {
      return Logic.guess;
    }

    enableHints() {
      hintsEnabled = true
    }
    disableHints() {
      hintsEnabled = false
    }

    guessBool(args){
      const comparison = args.COMPARISON

      switch (true) {
        case comparison === '>':
          return Logic.number > Logic.guess
          break;
        case comparison === '<':
          return Logic.number < Logic.guess
          break;
        default: return Logic.number === Logic.guess

      }
    }
  }

  Scratch.extensions.register(new baqSlashGTN());

})(Scratch);
